-- Cleanup

DROP TABLE IF EXISTS Has;
DROP TABLE IF EXISTS Works;
DROP TABLE IF EXISTS Admitted;
DROP TABLE IF EXISTS Condition;
DROP TABLE IF EXISTS HasTreated;
DROP TABLE IF EXISTS HealthcareWorker;
DROP TABLE IF EXISTS Role;
DROP TABLE IF EXISTS Hospital;
DROP TABLE IF EXISTS Patient;

-- DDL

CREATE TABLE Patient (
	ID INT,
	name VARCHAR(200) NOT NULL,
	city VARCHAR(100) NOT NULL,
	phone INT NOT NULL,
	PRIMARY KEY(ID)
);

CREATE TABLE Hospital (
	ID INT,
	name VARCHAR(200) NOT NULL,
	city VARCHAR(100) NOT NULL,
	type VARCHAR(100) NOT NULL,
	PRIMARY KEY(ID)
);

CREATE TABLE Role (
	ID INT,
	name VARCHAR(200) NOT NULL,
	market_average INT NOT NULL,
	PRIMARY KEY(ID)
);

CREATE TABLE HealthcareWorker (
	ID INT,
	name VARCHAR(200) NOT NULL,
	salary INT NOT NULL,
	phone INT DEFAULT NULL,
	RID INT REFERENCES Role(ID),              -- Has role relation
	PRIMARY KEY(ID)
);

CREATE TABLE Condition (
	ID INT,
	name VARCHAR(1000) NOT NULL,
	PRIMARY KEY(ID)
);

CREATE TABLE Works (
	HWID INT REFERENCES HealthcareWorker(ID),
	HID INT REFERENCES Hospital(ID),
	start_date DATE,
	quit_date DATE DEFAULT NULL,
	PRIMARY KEY(HWID, HID)
);

CREATE TABLE Admitted (
	PID INT REFERENCES Patient(ID),
	HID INT REFERENCES Hospital(ID),
	admitted_date DATE,
	discharged_date DATE DEFAULT NULL,
	PRIMARY KEY(PID, admitted_date)
);

CREATE TABLE HasTreated (
	HWID INT REFERENCES HealthcareWorker(ID),
	PID INT REFERENCES Patient(ID),
	PRIMARY KEY(HWID, PID)
);

CREATE TABLE Has (                            -- Has condition relation
	PID INT REFERENCES Patient(ID),
	CID INT REFERENCES Condition(ID),
	PRIMARY KEY(PID, CID)
);

